  false,\n\t\"url\": null,\n\t\"notes\": \"Field data collection was conducted for
  the U.S. Army Engineer District, Pacific Ocean, Honolulu (POH), during 21 March
  through 7 June 2007, in Kuhio Bay of Hilo, Hawaii (Big Island). Wave and current
  data were collected at three fixed locations using bottom-mounted RD Instruments
  Workhorse, 1.2 MHz, ADCPs (Acoustic Doppler Current Profilers). One of the instruments,
  located closest to the open ocean, included wave measurements. Of the other two
  units, one lost battery power on 7 April. Four inexpensive current drogues (drifters)
  were designed and built at the CHL Field Research Facility (FRF) that used GPS tracking
  and radio telemetry for positioning. Deployments were made on 22-23 March, 5-6 June,
  and 6-7 June.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
